  const { songs } = useSongs()

  if (songs) {
    if (songs.length > 0) {
      return (
        <div>
        <p>no songs</p>
        </div>
      )
    }
  } else {
    return (
      <div>
      <p>there are songs</p>
      </div>
    )
  }
}

export default Songs
